import axios from 'axios';
import React from 'react';
import Main from '../screen/main';

const MultiPlayerData = async(props) => {
    const boardData = {
        board:"  x      "
    }
    debugger
    const resp = await axios.get(`localhost:4000/multi_player?board=${boardData.board}&reset=true`)
    debugger
    console.log(resp)
    // return(
    //     <Main />
    // )
}


const SinglePlayerData = (props) => {
    debugger
    const boardData = {
        board:"         "
    }
    const resp = axios.get(`localhost:4000/single_player?${boardData}`)
    console.log(resp)
    debugger
}

export {MultiPlayerData,SinglePlayerData};
